import { makeStyles } from "@material-ui/core";
import React from "react";
import IPostSuggestion from "../../../Models/IPostSuggestion";
import TopPostsByViews from "./TopPostsByViews/TopPostsByViews";

interface IProps {
  topPostsByViews: IPostSuggestion[];
}

const useStyles = makeStyles({
  container: {
    minWidth: 414,
    height: 700,
    backgroundColor: "#F3F5F8",
    marginLeft: "8%",
    ["@media (max-width: 750px)"]: {
      display: "none",
    },
    paddingBlock: 30,
    paddingInline: 20,
  },
});

const Sidebar: React.FC<IProps> = ({ topPostsByViews }) => {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <TopPostsByViews topPosts={topPostsByViews} />
    </div>
  );
};

export default Sidebar;
